 import {useForm} from "react-hook-form";
function App() {
   const {register, handleSubmit, errors} = useForm();
  // const[userInfo, setUserInfo]=useState();
  //  const onSubmit = (data) =>{
  // //   setUserInfo(data);
  //    console.log(JSON.stringify(data));
  //    console.log(errors);
  // }
  const handleRegistration = (data) => {console.log(data)
                               alert("Registered Successfully")};
  return (
    <div>

    <form onSubmit = {handleSubmit(handleRegistration)}> 
   <div>
  <label>
        Name:</label>
    <input type="text" name="username" placeholder="Username" {...register('username')}
    />

  <br/>
  <br></br>
  <label>
        Email ID:</label>
    <input type="text" name="email" placeholder="Enter valid email id" {...register('email')}
    />
   <br/>
  <br></br>
  <label>
        Phone No:</label>
    <input type="text" name="phone" placeholder="Enter 10-digit mobile number" {...register('phone')}
    />
    <br/>
  <br></br>
  <label>
        Address:</label>
    <input type="textarea" name="address" placeholder="Enter address as on ID proof" {...register('address')}
    />
      <br/>
  <br></br>
  <label>
        Address:</label>
    <input type="textarea" name="address" placeholder="Enter address as on ID proof" {...register('address')}
    />
      <br/>
  <br></br>

  <label>
    Aadhar No:</label>
    <input type="text" name="adhar" placeholder="Enter valid Adhar no." {...register('adhar')}
    />
    </div>
  <button>Submit</button>

</form>
</div>
  );
}

export default App;
